import React, { useEffect } from 'react';
import Card from './Card';


function App(){

useEffect(()=>{
    fetch("https://api.imgflip.com/get_memes")
    .then(res=>res.json())
    .then(data=>console.log(data.data.memes.map((el)=>
        <Card name={el.name}/>
        )))
})
    return(
    <div>
        <Card/>
    </div>
    )

}
export default App
